import React from "react";
import PropTypes from "prop-types";

function Food({ name, rating }) {
  return (
    <div>
      <h3>I love {name}</h3>
      <h4>{rating}/5.0</h4>
    </div>
  );
}

const foodLike = [
  {
    id: 1,
    name: "kimchi",
    rating: 5,
  },

  {
    id: 2,
    name: "samgyeopsal",
    rating: 4.7,
  },
];

function App() {
  return (
    <div>
      {foodLike.map((dish) => (
        <Food key={dish.key} name={dish.name} rating={dish.rating} />
      ))}
    </div>
  );
}

Food.PropTypes = {
  nameL: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
};

export default App;
